import React from 'react';

function HelloDiv() {
  return <div>
  <p>Hello my name is Tony</p>

  <ul><i>Things I like: </i>

  <li>Basketball</li>
  <li>Eating</li>
  <li>Sleeping</li>
  </ul>
  </div>;
}



export default HelloDiv;
